import React from "react";
import "./Gobackbtn.css";

goBack = () => {
  window.history.back;
};

const Gobackbtn = props => {
  return (
    <div className="goback-btn">
      <i
        className="far fa-arrow-alt-circle-left"
        type="button"
        value=""
        onclick="goBack()"
      >
        {" "}
      </i>
    </div>
  );
};

export default Gobackbtn;
